import "./Home.css";
import Header from "../../components/header/Header";
import React, { useEffect } from "react";
import { Base } from "../../components/Base";
import CSSProps from "../../data/constants/CSSProps";
import Article from "../../components/article/Article";

const Home = () => {
  useEffect(() => {
    Base.prototype.SwitchPage(CSSProps.ID.Home);
  });
  return (
    <div>
      <Header className="Header" />
      <div className="columns">
        <div className="column main-column">
          <Article title="Article new" content="conect new" info="Info New" to="www.google.nl" img="https://images.ctfassets.net/hrltx12pl8hq/7yQR5uJhwEkRfjwMFJ7bUK/dc52a0913e8ff8b5c276177890eb0129/offset_comp_772626-opt.jpg?fit=fill&w=800&h=300">
          </Article>
          <article className="article">Hello World</article>
          <article className="article">Hello Konjo</article>
        </div>

        <div className="column">
          <article className="article">Hello Esther</article>
          <article className="article">Foo Bar</article>
          <article className="article">Hello World</article>
        </div>
      </div>
    </div>
  );
};

export default Home;
